description: |-
  Professional strength for high-level 3D prints.
  Looking for high-quality filament for furniture, prototypes, or decoration?

  The Winkle ASA Filament 1.75 mm is the ultimate choice for 3D-printing enthusiasts seeking industrial-grade quality without sacrificing aesthetics.
  Available in 250 g, 1 kg, and 5 kg formats, and in ash gray, natural, and jet black, this 3D printer filament is designed to simplify demanding projects.

  Thanks to its high toughness, low shrinkage, and excellent resistance to weathering and UV light, this ASA 3D Filament withstands extreme conditions: sun exposure, water, impacts, and elevated temperatures. It is perfect for those seeking durable 3D prototypes, functional parts, or structural components that maintain their shape and color over time.
